            <hr />

            <Link to="/aboutus" className="hdm">
              ABOUT
            </Link>
            <hr />

            <Link to="/contact" className="hdm">CONTACT US</Link>
            <hr />

            <Link to="/APPLICATIONS" className="hdm">APPLICATIONS</Link>
            <hr />
            {/* <Link to="/signin" className="hdm">SIGNIN</Link>
            <hr /> */}
          </div>
        </div>

    </div>
    </div>
  );
}

export default Head;
